          "name": "Monitoramento e Controle",
          "description": "Este subprocesso realiza o monitoramento e controle do projeto, focando os seguintes aspectos:\r\n1) Escopo: mudanças;\r\n2) Prazo;\r\n3) Custo;\r\n4) Riscos;\r\n5) Recursos Humanos;\r\n6) Aquisições.\r\n\r\nA monitoração nos pontos de controle se dará conforme periodicidade definida no status das revisões do projeto no DN-13 Plano do Projeto.\r\nEsta monitoração se dará a partir da fase de elicitação de requisitos e deverá avaliar todos os planos anexos ao plano do projeto, não inviabilizando as monitorações nos marcos do projeto.\r\nA evidência desta monitoração deverá ser registrada no DN-33 Monitoramento e para o caso de desvios encontrados deverão ser atualizadas as versões dos planos referentes e ser controlada no DN-14 cronograma.\r\n\r\n\r\n",
