              "name": " Identificar como Requisito de Usabilidade",
              "description": "O requisito de usabilidade a ser considerado pode seguir uma destas categorias:\r\n   • Fatores humanos;\r\n   • Estética;\r\n   • Consistência na interface do usuário;\r\n   • Ajuda on-line e contextual;\r\n   • Assistentes e agentes;\r\n   • Documentação do usuário;\r\n   • Materiais de treinamento.\r\n",
