              "description": "O Requisitos externo é conseqüência de fatores externos ao sistema e ao processo de desenvolvimento (legislação, etc.). São requisitos que podem ser colocados no produto e no processo derivados do ambiente que é desenvolvido. Eles podem fundamentar-se nas informações de domínio da aplicação.\r\n",
