              "name": " Identificar como Funcional",
              "description": "O requisito funcional é aquele que pode ser depreendido do modelo de caso de uso. Ele descreve o que o produto tem de fazer ou que ações processuais deve ser realizada pelo sistema, sem levar em consideração restrições físicas. Este procedimento é descrito em um modelo de casos de uso. \r\n\r\nO requisito funcional especifica o comportamento de entrada e saída de um sistema. Podem incluir:\r\n    • Conjuntos de recursos;\r\n    • Habilidades;\r\n    • Segurança.\r\n\r\n",
