              "description": "O requisito de portabilidade a ser considerado pode seguir uma destas categorias:\r\n    • Possibilidade de reuso de teste;\r\n    • Extensibilidade;\r\n    • Adaptabilidade;\r\n    • Compatibilidade;\r\n    • Possibilidade de configuração;\r\n    • Possibilidade de serviço;\r\n    • Possibilidade de instalação;\r\n    • Possibilidade de localização (internacionalização).\r\n",
