              "name": " Identificar como Não-Funcional",
              "description": "O requisito não-funcional definem propriedades e restrições do sistema (tempo, espaço, etc).  Os requisitos não funcionais são tão importantes quanto os requisitos funcionais. \r\nDevido à sua própria definição, requisitos não-funcionais são geralmente mensuráveis. Assim, deve-se associar forma de medida/referência a cada requisito não-funcional elicitado.\r\n\r\n",
