              "description": "Estimar o tamanho do projeto utilizando o método definido pela organização.\r\n\r\nO gerente do projeto pode optar pelos seguintes métodos:\r\n\r\n1) Ponto por Função: este método é o mais utilizado. O DN-13b Estimativa de Caso de Uso ou DN-13c Contagem de Caso de Uso auxilia o gerente de projeto na atividade de estimativa e contagem do Ponto de Função.\r\n\r\n2) Ponto do Caso de Uso: No caso desta forma de contagem ser definida, o DN-13a Pontos por Caso de Uso, deve ser utilizado. \r\n\r\n3) O Método Delphi: é baseado no principio de que estimativas de um grupo estruturado de especialistas. Este método é mais preciso do que as estimativas derivadas de um grupo informal ou de indivíduos isolados.\r\n\r\n4) Outro método a ser definido (e justificado).\r\n\r\n\r\n",
