                  "name": "Responsabilidades",
                  "value": "1.Planejar as atividades e os recursos de hardware, de software e humanos para atendimento ao projeto, visando assegurar a adequação às prioridades definidas;\n2.Coordenar e controlar a execução das atividades e gerir os recursos de hardware, de software e humanos para atendimento ao projeto, conforme planejamento do projeto;\n3;Comunicar, a quem de direito, sobre problemas, resultados inesperados, mudanças ou qualquer outro fato relevante;\n4.Elaborar e manter atualizado os documentos;\n5.Fazer a avaliação inicial de uma mudança antes de submetê-la ao CCM;\n6.Aprovar os artefatos resultantes de cada fase do projeto. Aprovar os artefatos finais, autorizando a implantação no cliente.",
