              "name": "Integração e Testes",
              "description": "PROPÓSITO: O propósito desta fase é definir a sequência de integração de um produto e realizar a sua integração, além de realizar os testes de verificação. \r\n\r\nDESCRIÇÃO: O arquiteto irá definir a estratégia de integração do produto.  Esta estratégia pode ser dos seguintes tipos:\r\n   • BottomUp;\r\n   • TopDown;\r\n   • Sanduiche;\r\n   • Orientada a risco;\r\n   • Orientada a funcionalidade;\r\n   • Em Forma de T\r\nO software será integrado seguindo a estratégia definida no plano. \r\nApós a integração, será realizado os testes de verificação necessários, utilizando os cenários de teste.",
