                  "name": "Detalhamento",
                  "value": "• Revisar plano do projeto\nRevisar o plano do projeto para definir a próxima iteração. Verificar o plano do projeto, incluindo todos os documentos e planos associados, atualizando-os se necessário. Identificar as atividades previstas para esta iteração e ainda não encerradas para alocá-las para a iteração seguinte.\n\n• Definir os objetivos da iteração seguinte\nSe uma nova iteração for necessária, definir objetivos para esta próxima iteração tais como:\n           \triscos críticos ainda não mitigados.\n           \ttempo planejado para a iteração.\n           \trequisitos para garantir que características criticas sejam desenvolvidas. \n           \tPriorizar tarefas para a próxima iteração ou encerrar o projeto\n• Definir as prioridades para a próxima iteração, registrando-as em Ata.\n",
