              "description": "ECO SISTEMAS\r\nBusca da Excelência\r\n\r\n\"O Caminho da Excelência: a excelência em uma Organização depende fundamentalmente de sua capacidade de perseguir seus propósitos em completa harmonia com o seu Ecossistemas.\" Fundação Nacional da Qualidade - 2010\r\n\r\nA ECO Sistemas ao longo de sua história busca a excelência da gestão de forma planejada. Desde 2004, realiza continuamente a melhoria do atendimento dos serviços através da implementação de modelos reconhecidos no mercado, por Organizações de Classe Mundial, conforme apresentamos abaixo.\r\n2011\r\n\r\n    * Recertificação ISO 9001:2008 pela ABNT\r\n\r\n2010\r\n\r\n    * Prêmio ASSESPRO - Melhores Empresas\r\n      - Melhor Projeto para o Governo com UPA Paperless\r\n      - Melhor Projeto de Apoio á Decisão com INTUS\r\n\r\n2009 \r\n\r\n    * Recertificada na norma ISO 9001:2008, pelo Bureau Veritas.\r\n    * Premiada pela Assespro-RJ: TRS - Melhor Solução em Geoprocessamento; STOK - Melhor Solução de Logística; SAHRA - Melhor Solução em Segurança e Saúde do Trabalho.\r\n    * Certificada pela Softex no modelo de Melhoria de Processos de Software Brasileiro (MPS.BR) – Nível F\r\n    * Certificada pelo Software Engineering Institute (SEI) no modelo Capability Maturity Model Integration for Development (CMMI -Dev) - Nível 2.\r\n    * Prêmio ASSESPRO - Melhores Empresas\r\n      - Melhor Solução em Geoprocessamento com o TRS\r\n      - Melhor Solução de Logística com o STOK\r\n      - Melhor Solução da Saúde e Segurança do Trabalho com UPA 24h\r\n\r\n2008 \r\n\r\n    * Recertificada na norma ISO 9001:2000, desta vez pelo Bureau Veritas, atestando a maturidade de seus procedimentos internos de qualidade.\r\n    * Conquista do reconhecimento máximo do Prêmio Qualidade Rio 2008, com o diploma \"Medalha de Ouro\".\r\n\r\n2006\r\n\r\n    * Conquista da \"Medalha de Prata\" no Prêmio de Qualidade Rio 2006.\r\n\r\n2005 \r\n\r\n    * Certificada pela Acreditadora RINA na norma ISO 9001:2000, em todas as áreas de atuação. Nessa época foi premiada em seu sistema de gestão hospitalar, Klinikos ®, como melhor software na área de Saúde - RIO INFO 2005.\r\n    * Conquista da \"Menção Honrosa\" no Prêmio de Qualidade Rio 2005.\r\n\r\n2004\r\n\r\n    * Criação do Grupo Gestor da Qualidade.\r\n\r\n",
