              "id": "96a769dc-511d-4c34-ac62-230c6571165a",
              "name": "Formalizar acordo com fornecedor",
              "description": "Negociar e definir os termos e condições dos acordos formais (contratos, licenças ou memorandos de entendimento) a serem estabelecidos entre a Organização que representa o projeto e o fornecedor. Garantir que todas as partes envolvidas entenderam e estão de acordo com o que foi estabelecido antes do acordo formal ser firmado. Sempre que necessário o Acordo deve ser revisto\r\n",
