              "name": "Elaborar Modelo de Requisito no EA",
              "description": "Após a identificação, os requisitos devem ser modelados para se obter uma melhor compreensão do produto a ser desenvolvido. O modelo dos requisitos deve focar naquilo que o produto deve fazer, não em como ele o faz. Geralmente, usa-se uma notação gráfica para descrever as informações transformadas pelo produto, o processamento das informações, o comportamento do produto e outras características [PRESSMAN, 2005].",
