              "id": "b55d04ca-b239-4a0d-8531-c8665e3b77ff",
              "name": "Cascata",
              "description": "O Ciclo Cascata deve ser escolhido quando as fases serão executadas sequencialmente, com pontos de controle bem definidos e a entrega do produto só ocorrerá depois de terminado. Neste caso o projeto de arquitetura só deve começar após obtenção dos requisitos que devem ser completos, não ambíguos e não redundantes.",
