              "name": "Iterativo/incremental",
              "description": "O Ciclo Iterativo Incremental deve ser utilizado para projetos maiores que não se conhece todo o escopo ou que se espera entregas parciais. \r\n\r\nEspera-se que as fases Análise de Viabilidade e Plano do Projeto sejam executadas um vez, e que todas as outras sejam executadas em cada ciclo.",
