              "name": "Qual ciclo de vida definido?",
              "description": "Escolher o tipo de ciclo de vida a ser definido pelo projeto, baseado nos seguintes critérios a seguir:\r\n\r\n1) ESCOPO: \r\n   - Até 300PF: Cascata ou Scrum;\r\n   - Acima de 300PF: Iterativo.\r\n\r\n2) TEMPO:\r\n   - Até 3 meses: Cascata ou Scrum;\r\n   - Acima de 3 meses: Iterativo ou Scrum.\r\n\r\n3) TECNOLOGIA e NEGÓCIO:\r\n   - Domínio da tecnologia e do negócio: Cascata ou Scrum;\r\n   - Falta de domínio da tecnologia ou negócio: Iterativo ou Scrum;\r\n\r\n4) PRODUTO:\r\n   - Próprio: Cascata ou Iterativo;\r\n   - Projeto de terceiros: Iterativo ou Scrum;",
