              "name": "Conduzir o  smoke test diariamente",
              "description": "Subconjunto de todos os casos de testes definidos/planejados que cobre a principal funcionalidade de um componente ou sistema, para averiguar as principais funções de um programa em funcionamento sem se preocupar com maiores detalhes. A realização diária de testes de construção e teste básico está entre as melhores práticas de engenharia de software. Consiste em identificar a principal funcionalidade do sistema e realizar um teste simples desta funcionalidade e não já sair testando tudo de uma vez. \r\nO smoke test exercita o sistema numa única passagem, em geral empregando um script de execução automática, não devendo ser exaustivo, e sim capaz de expor os maiores problemas. O smoke test é executado após a construção de cada nova versão\r\n\r\n\r\n",
