              "name": "7.Descrição da Rotina",
              "value": "Obter informações de peritos e  compartilhar resultados com as partes interessadas (stakeholders) e tomadores de decisão.\n\nIDENTIFICAR OS FATORES DE RISCO ADICIONAIS\nCaracterísticas dos principais modelos de ciclo de vida utilizados para a produção de software.\n\n\n•Prevenção: Evitar o risco, decidindo-se não iniciar ou continuar a atividade que o gera (quando possível).\n•Controle: Adoção de medidas para trazer o risco para níveis toleráveis.\n•Mitigação: Adoção de medidas para compensar os conseqüências do risco.\n•Planos de Emergência: Determinação das atividades a serem desenvolvidas no caso de ocorrência dos riscos.\t\nEste modelo procura determinar a chance de 4 fatores críticos serem atingidos a partir da estimativas relativas a 23 fatores de risco.\n\nCada célula desta matriz pode assumir para a linha i os valores 0 ou 1, de acordo com a influência do fator de risco em relação ao critério de sucesso, isto é, se o valor da linha i é igual a 0, significa que este fator não afeta o critério de sucesso j, se este valor é igual a 1, significa que afeta este mesmo critério.\n",
