      "id": "f577bf7f-b9d1-45c2-9052-0c29d17c988f",
      "name": "PQ22_PROCESSO_ORGANIZACIONAL",
      "description": "Este PROCESSO ORGANIZACIONAL descreve as fases pelas quais o software passa desde a sua concepção até sua descontinuação na ECO Sistemas. \r\n\r\n\r\nEste documento é compatível com: \r\n.Norma ISO 9001:2008 \r\n.Modelo de referência MPS.Br – Melhoria de Processos do Software Brasileiro – nivel F – v1.2 .\r\n.Modelo de referência CMMI-DEV – Capability Maturity Model Integration for Development – nivel 2 – v1.2",
