          "name": "PQ-22 PROCESSO ORGANIZACIONAL",
          "description": "Este PROCESSO ORGANIZACIONAL descreve as fases pelas quais o software passa desde a sua concepção até sua descontinuação na ECO Sistemas.\r\nNossa proposta identifica 6 fases que são delimitadas por eventos típicos em diversos ciclos de vida. Cada fase inclui um conjunto de atividades ou disciplinas que devem ser realizadas pelas partes envolvidas. Essas fases são:\r\n- Comercialização\r\n- Planejamento do Contrato\r\n- Desenvolvimento\r\n- Operação\r\n- Manutenção\r\n- Encerramento do Contrato",
