              "name": "PQ-17 Gerência\n de Configuração",
              "description": "Estabelecer e manter a integridade dos produtos de trabalho, através de um processo que inclui:\r\n• Identificar os itens de configuração;\r\n• Guardar e controlar da configuração dos itens;\r\n• Comunicar a comunicação do status da configuração;\r\n• Realizar auditorias sistemáticas e planejadas da configuração.\r\nTodos os envolvidos no processo de desenvolvimento/manutenção de software devem realizar atividades de gerência de configuração. O gerente de configuração realiza atividade como auditar a configuração dos projetos. Os dados e resultados específicos dos projetos são armazenados em um repositório específico constituído de uma estrutura padrão de diretórios e pastas. \r\n",
