                  "value": "Protótipos são apenas modelos do produto final e não precisam ser completos. São muito úteis para avaliação de requisitos críticos ou complexos.\nA prototipação inclui os seguintes passos: \n1-Estudo preliminar dos requisitos do usuário. \n2-Construção do protótipo. \n3-Exame realizado pelos Fornecedores de Requisitos. \n",
